import React, { Component } from 'react';
// import logo from './assets/logo.png';
import slack from './assets/slack.svg';

class App extends Component {
  render() {
    return (
      <div className="App">
        <header>
          {/* <img src={logo} className="logo" alt="Dev London logo" /> */}
          {/* <p>Bringing the Forest City tech community together.</p> */}
          <h1>Bringing tech <span className="pop">together</span><br />in the <span className="pop">Forest City</span></h1>
          <div className="action-container">
            <button className="call-to-action slack button-shadow">
              <img src={slack} className="slack-img" alt="Slack logo" />
              join the community
            </button>
            <button className="call-to-action meetup">
              come to an event
            </button>
          </div>
        </header>
        <div className="body"><button className="call-to-action slack effect2">
              <img src={slack} className="slack-img" alt="Slack logo" />
              join the community
            </button></div>
      </div>
    );
  }
}

export default App;
